import React from 'react';
import './PeoplesPage.css';

const PeoplesPage = () => {
    return (
        <div className="peoples-page">
            <div className="sidebar">
                <a href="#faculty">Faculty</a>
                <a href="#affiliated-faculty">Affiliated Faculty</a>
                {/* ... more links */}
            </div>
            <div className="main-content">
                <section id="faculty">
                    <h2>Faculty</h2>
                    {/* List of faculty members */}
                </section>
                <section id="affiliated-faculty">
                    <h2>Affiliated Faculty</h2>
                    {/* List of affiliated faculty members */}
                </section>
                {/* ... more sections */}
            </div>
        </div>
    );
};

export default PeoplesPage;
